import './banner.scss'
import React from 'react'

function Banner({ children, title, subtitle }) {
    return (
        <div className="banner">
            <h1>{title}</h1>
            <div></div>
            <p>{subtitle}</p>
            {children}
        </div>
    )
}

export default Banner
